var Click = /(iPhone|iPad|iPod|iOS|Android)/i.test(navigator.userAgent)?'tap':'click';
var myScroll;
function refresh(num){
	if(!myScroll)return;
  setTimeout(function(){myScroll.refresh()},num)
};
